import React from 'react';
import '../assets/About.css';

const Privacy = () => (
  <div className="page privacy-page">
    <h1>Политика конфиденциальности</h1>
    <p>Описание политики конфиденциальности сайта.</p>
  </div>
);

export default Privacy;
